const User= (props) =>{

    console.log(props.userData.followers.length)
    return(
        <div>
            <p>Username: {props.userData.username}</p>
            <p>{props.userData.first_name} {props.userData.last_name}</p>
            <h3>{props.userData.followers.length}</h3>
        </div>

    )
}

export default User;
